import React from 'react';
import './App.css';

function Project({name, description}) {
    return(
        <div className="project">
            <text><span>{name}</span></text>
            <text><span>Sample Image</span></text>
            <text><span>{description}</span></text>
        </div>
    );
}

export default Project;
